import { Routes, Route } from "react-router-dom";
import MijnGroningen from '../pages/MijnGroningen';
import Home from '../pages/Home'

function Routing () {

    return (
        <Routes>
        <Route path="" element={<Home />}></Route>
        <Route path="/mijngroningen" element={<MijnGroningen />}></Route>
      </Routes>
    );
}

export default Routing;
